import React from "react";

import ReactDOM from 'react-dom';

import Grid from '@material-ui/core/Grid';

import { SocialIcon } from 'react-social-icons';

import StickyFooter from 'react-sticky-footer';

const Footer = () => {
  return (
<div>
    <StickyFooter
    stickAtThreshold= {2}
    normalStyles={{
    color: "white",
    backgroundColor: "black",
    opacity: 1
    }}
    stickyStyles={{
    color: "transparent",
    backgroundColor: "transparent",
    padding: "2rem",
    position: "fixed",
    left: "30%",
    direction: "column",
    alignItems: "center"
    }}
    >
        <Grid container
            spacing={3}
            direction="row"
            alignItems="center"
            justify="center"
    >
        <Grid item lg={3}>
    <h3>843-271-3434</h3>
    </Grid>
    <Grid item lg={3}>
    <h3>E: walkerkeatley@yahoo.com</h3>
    </Grid>
    <Grid item lg={3}>
        <h3>Follow me on Social Media:</h3>
        <SocialIcon url="https://twitter.com/blackfalcon_unc" />
        <SocialIcon url="https://www.instagram.com/floyds_fotos/" />
        <SocialIcon url="https://github.com/walkerfloyd1" />
        <SocialIcon url="https://www.linkedin.com/in/walker-floyd-b53182123/" />
    </Grid>
        </Grid>
</StickyFooter>
</div>
  );
}

export default Footer;
